"use strict";(self.webpackChunkcllm_website=self.webpackChunkcllm_website||[]).push([[203],{2156:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/cllm/blog/welcome","editUrl":"https://github.com/dev-backpack/cllm/cllm-website/blog/2024-03-15-welcome/index.md","source":"@site/blog/2024-03-15-welcome/index.md","title":"Welcome","description":"Hello and Welcome to the CLLM documentation!","date":"2024-03-15T00:00:00.000Z","formattedDate":"March 15, 2024","tags":[{"label":"welcome","permalink":"/cllm/blog/tags/welcome"}],"readingTime":0.62,"hasTruncateMarker":false,"authors":[{"name":"Chanwoong Kim","title":"Owner of CLLM","url":"https://github.com/ykdy3951","imageURL":"https://github.com/ykdy3951.png","key":"chanism"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["chanism"],"tags":["welcome"]},"unlisted":false},"content":"Hello and Welcome to the **CLLM** documentation!\\n\\nCLLM is a **C**ommand **L**ine **L**arge Language **M**odel tool that is designed to help you write cli-command.\\nCurrently, CLLM is based on **GPT-3.5 Turbo** Model, which is a large language model developed by OpenAI.\\n\\nBelow are the list of commands that you can use to interact with CLLM.\\n- `help` - To get the list of commands that you can use.\\n- `search` - To search for a specific command about your query.\\n- `set key` - To set the OpenAI API key for using CLLM.\\n- `history` - To get the history of (query, command) that you have used.\\n\\nIf you have any questions or need help, feel free to ask in the [CLLM Discord](https://discord.gg/sy9BhhdbJu).\\n\\n![cllm-example-1](./cllm-example-1.gif)"}]}')}}]);